public void init()
{
    super();

    if (!element.args().record())
    {
        throw error(Error::wrongUseOfFunction(this.name()));
    }

    transDate = DateTimeUtil::getSystemDate(DateTimeUtil::getUserPreferredTimeZone());
    budgetModel = (select firstonly BudgetModel).ModelId;

    rassetStandards.data(element.args().record());

    rAssetSumTrans = RAssetSumCalc_Trans::newAssetPeriod(rassetStandards.AssetId, rassetStandards.AssetStandardId, transDate);
    rAssetSumBudget  = RAssetSumCalc_Budget::newAssetPeriod(rassetStandards.AssetId,
        rassetStandards.AssetStandardId,
        budgetModel,
        transDate);

    this.updateTotals();
}

public boolean isMainAsset(RAssetStandards _rAssetStandards)
{
    boolean ret;

    if (!_rAssetStandards.Depreciation
        && (select firstonly RecId from rAssetTable
        where rAssetTable.AccountNumMain == _rAssetStandards.AssetId).RecId)
    {
        ret = true;
    }

    return ret;
}

public display RAssetTransDate lastTransDate()
{
    return RAssetTrans::transLastDate(rAssetStandards.AssetId, rAssetStandards.AssetStandardId, true);
}

public edit RAssetTransDate transDate(boolean _set, RAssetTransDate  _transDate)
{
    if (_set)
    {
        transDate = _transDate;

        this.updateTotals();
    }
    return  transDate;
}

private void makeVisibleMSTControls()
{
    boolean visible = rAssetStandards.AssetStandardId == RAssetParameters::find().StandardIdDefault
        && rAssetStandards.CurrencyCode != Ledger::accountingCurrency(CompanyInfo::current());

    RealizedColumnHeaderMST.visible(visible);
    actualAcquisitionPriceMST.visible(visible);
    actualNetBookValueMST.visible(visible);
    actualAcquisitionValueMST.visible(visible);
    actualAcquisitionAdjValueMST.visible(visible);
    actualRevaluationValueMST.visible(visible);
    actualDepreciationValueMST.visible(visible);
    actualDepreciationAdjValueMST.visible(visible);
    actualDisposalSaleValueMST.visible(visible);
    actualDisposalScrapValueMST.visible(visible);
    actualDisposalDisposedValueMST.visible(visible);
    actualWriteUpAdjValueMST.visible(visible);
    actualWriteDownAdjValueMST.visible(visible);
    actualProfitLossValueMST.visible(visible);
    actualTakeDownAcqAdjValueMST.visible(visible);
    actualTakeDownDeprAdjValueMST.visible(visible);
}

public void updateTotals()
{
    rAssetSumTrans.parmRangeAssetId(rAssetStandards.AssetId);
    rAssetSumTrans.parmRangeAssetStandard(rAssetStandards.AssetStandardId);
    rAssetSumTrans.parmDateTo(transDate);
    rAssetSumTrans.parmSumDescendants(this.isMainAsset(rAssetStandards));

    rAssetSumBudget.parmRangeAssetId(rAssetStandards.AssetId);
    rAssetSumBudget.parmRangeBudgetModel(budgetModel);
    rAssetSumBudget.parmRangeAssetStandard(rAssetStandards.AssetStandardId);
    rAssetSumBudget.parmDateTo(transDate);

    this.makeVisibleMSTControls();

    rassetStandards_DS.refresh();
}

public void linkActive()
{
    super();

    element.updateTotals();
}
